import React, { useState, useEffect } from 'react';

const JobList = () => {
    const [jobs, setJobList] = useState([]);
    const queriedJobs =[];

    useEffect(() => {
        fetch(`/searchAll`)
        .then(response => response.json())
        .then(data => {setJobList(data);
        console.log(data);})
        .catch(error => console.error('Error fetching data:', error));
    }, [id]);

    
    const findByAnimal = (animalName) =>{
        fetch(`/searchByAnimal?animal=${animalName}`)
            .then(response => response.json())
            .then(data => {
                for (let i = 0; i < data.length; i++){
                    queriedJobs.unshift(data[i])
                }
            })
            .catch(error => console.error('Error fetching data:', error));
    };


    const findById = (idNumber) =>{
        fetch(`/searchById?id=${idNumber}`)
            .then(response => response.json())
            .then(data => {
                queriedJobs.unshift(data[0]);
            })
            .catch(error => console.error('Error fetching data:', error));
    };

    const handleSubmit = (event) => {
        event.preventDefault();
        if (id){findById(id);}
        if (animal) {findByAnimal(animal);}
        setJobList(queriedJobs);
    };


    return (
        <div>
            <h1>List of Jobs</h1>
            <form onSubmit={handleSubmit}>
                <label>ID: </label>
                <input 
                    type="text" 
                    name="id" 
                    placeholder="Enter ID"/>

                <label><br></br>Animal: </label>
                <input 
                    type="text" 
                    name="animal" 
                    placeholder="Enter Animal Species"/>

                <button type="submit">Submit</button>
            </form>
            <table>
                <tbody>
                    {jobs.map(job => (
                        <tr key={job.id}>
                            <td>{job.id}</td>
                            <td>{job.username}</td>
                            <td>{job.animal}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default JobList;
